import React from 'react';
import s from "./Header.css";

export default function Header() {
  return (
    <header>
      <div className='header'>
        <li className='logo'></li>
        <button className='Catalog'>Catalog</button>
        <ul className='navigation'>
          <li>Main Page</li>
          <li>All Products</li>
          <li>All sales</li>
          <li></li>
        </ul>
        <li className='cart'></li>
      </div>
    </header>    
  )
}
